import React, { Component } from "react";
import "./App.css";

class FolderBlock extends Component {
  render() {
    return (
      <div className="assets flex-row listViewWidth">
          {showTreeView ? <TreeAssetView assets={assets} /> : null}
          {<View {...props} renderHeader={this.renderHeader} noAssetsMessage={noAssetsMessage} />}
        </div>
    );
  }
}

export default FolderBlock;
